import MyMap from "./MyMap";
import { Grid } from 'semantic-ui-react'

class HomePage extends Component {


    render() {
        const widthStyle = {
            padding: '50px'
        }
        return (
            <div className="ui list">
                <div className="item">
                    <i className="map marker icon"></i>
                    <div className="content">
                        <a className="header">Krolewskie Jadlo</a>
                        <div className="description">An excellent polish restaurant, quick delivery and hearty, filling
                            meals.
                        </div>
                    </div>
                </div>
                <div className="item">
                    <i className="map marker icon"></i>
                    <div className="content">
                        <a className="header">Xian Famous Foods</a>
                        <div className="description">A taste of Shaanxi's delicious culinary traditions, with delights
                            like spicy cold noodles and lamb burgers.
                        </div>
                    </div>
                </div>
                <div className="item">
                    <i className="map marker icon"></i>
                    <div className="content">
                        <a className="header">Sapporo Haru</a>
                        <div className="description">Greenpoint's best choice for quick and delicious sushi.</div>
                    </div>
                </div>
                <div className="item">
                    <i className="map marker icon"></i>
                    <div className="content">
                        <a className="header">Enid's</a>
                        <div className="description">At night a bar, during the day a delicious brunch spot.</div>
                    </div>
                </div>
            </div>
        );
            {/*<div className='container' style={widthStyle}>*/}
            {/*    <div className="ui message">*/}
            {/*        <div className="header">*/}
            {/*            Here you will see the illustration of different ways to monitor traffic over a period of time.*/}
            {/*        </div>*/}
            {/*        <ul className="list">*/}
            {/*            <li> Interactive Vehicle Density Map</li>*/}
            {/*            <li> Overlap of Construction and Traffic Map</li>*/}
            {/*        </ul>*/}
            {/*    </div>*/}

            {/*    Here you will see the illustration of different ways to monitor traffic over a period of time.*/}
            {/*    Interactive Vehicle Density Map*/}
            {/*    Overlap of Construction and Traffic Map*/}
            {/*    Collision Data Map*/}
            {/*    Hastings Travel Time Monitoring System*/}

    }
}


export default HomePage;
